import React, { useState, useEffect } from 'react';
import SplashScreen from './SplashScreen';
import './styles.css';
import dnaVideo from './assets/dnaHologram'

function App() {
  const [showSplash, setShowSplash] = useState(true);
  const [fadeClass, setFadeClass] = useState('');
  const [page, setPage] = useState('upload');

  useEffect(() => {
    const timer = setTimeout(() => {
      setFadeClass('fade-out');
      setTimeout(() => {
        setShowSplash(false);
      }, 1000);
    }, 3000);

    return () => clearTimeout(timer);
  }, []);

  const handleUpload = () => {
    setPage('results');
  };

  return (
    <div className="App">
      {showSplash ? (
        <div className={`splash-wrapper ${fadeClass}`}>
          <SplashScreen />
        </div>
      ) : (
        <div className="main-menu">
          {/* Big heading */}
          <h1>GeneSight</h1>
          <h2>Upload Your Gene Expression Data</h2>
          <p className="description">
            Get a quick and explainable risk assessment for disease prediction.
          </p>

          {/* Hologram */}
          <div className="hologram-container">
            {/* Replace this <img> or <video> with your actual video or image */}
            <video
              src="/path/to/your/hologram.mp4"
              autoPlay
              loop
              muted
              style={{ width: '100%', height: '100%', objectFit: 'cover' }}
            />
          </div>

          {/* If we are on the "upload" page, show file input & button */}
          {page === 'upload' ? (
            <div className="upload-section">
              {/* A "label" that acts like a button for the file input */}
              <label htmlFor="file-upload" className="file-label">
                Select File
              </label>
              <input
                id="file-upload"
                className="file-input"
                type="file"
                onChange={(e) => console.log('File selected:', e.target.files[0])}
              />
              <button className="upload-button" onClick={handleUpload}>
                Upload Files Now
              </button>
            </div>
          ) : (
            /* "results" page content */
            <div className="upload-section">
              <h2>Analysis Results</h2>
              <p>Your model predictions or data visualizations go here!</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
